    {
        imgUrl: weatherImg,
        title: 'Calculate Weather',
        desc: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Laborum voluptatum omnis possimus.'
    },
    {
        imgUrl: guideImg,
        title: 'Calculate Weather',
        desc: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Laborum voluptatum omnis possimus? Quod .'
    },
    {
        imgUrl: customImg,
        title: 'Calculate Weather',
        desc: 'Lorem ipsum dolor sit amet, consectetur adipisicing elit. Laborum voluptatum omnis possimus? Quod similique delectus error, ex ab reiciendis amet vitae. Aut iste aliquam neque voluptate iusto, natus eos nulla.'
    },
]

const ServicesList = () => {
    return <>
        {
            servicesData.map((item, index) =>
                <Col lg='3' key={index}>
                    <ServicesCard item={item} /> </Col>)
        }
    </>
}

export default ServicesList
